  `mostrarQuincenas` tinyint(1) NOT NULL COMMENT '0-1 Mostrar quincena a la hora de facturar.',
  `mostrarTrimestral` tinyint(1) NOT NULL COMMENT '0-1 Mostrar trimestral en facturación',
