--
-- Estructura de tabla para la tabla `tm_usuario`
--

CREATE TABLE `tm_usuario` (
  `idUsu` int(11) NOT NULL,
  `nickUsu` varchar(100) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'NickName - Nombre Rapido para login',
  `correoUsu` varchar(120) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Correo del Usuario, se puede usar en login',
  `senaUsu` varchar(255) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Contraseña Usuario',
  `rolUsu` int(11) DEFAULT NULL COMMENT '0 = Usuario | 1 = Administrador | 3 = Otros..\r\n10 = Soporte Tickets 11 = Clientes Tickets',
  `estUsu` tinyint(4) DEFAULT NULL COMMENT 'Estado del Usuario\r\n0 = Desactivado\r\n1 = Activado',
  `obsUsu` longtext COLLATE utf8mb4_spanish2_ci,
  `avatarUsu` varchar(255) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Avatar foto de perfil',
  `generoUsu` varchar(100) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Genero',
  `fecAltaUsu` datetime DEFAULT NULL COMMENT 'Fecha de Alta',
  `fecBajaUsu` datetime DEFAULT NULL COMMENT 'Fecha de Baja',
  `fecModiUsu` datetime DEFAULT NULL COMMENT 'Fecha Modificación',
  `motivoBajaUsu` mediumtext COLLATE utf8mb4_spanish2_ci COMMENT 'Motivo de Baja / Ban',
  `nombreUsu` varchar(255) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Nombre del usuario',
  `apellidosUsu` varchar(255) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Apellidos del usuario',
  `fechaNacimientoUsu` date DEFAULT NULL COMMENT 'Fecha de nacimiento del usuario',
  `telefonoUsu` varchar(20) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Número de teléfono del usuario',
  `movilUsu` varchar(20) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Número de celular del usuario',
  `razonSocialFacturacionUsu` varchar(255) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Razón social para facturación',
  `identificacionFiscalUsu` varchar(50) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Número de identificación fiscal',
  `direccionFacturacionUsu` varchar(255) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Dirección de facturación',
  `codigoPostalUsu` varchar(120) COLLATE utf8mb4_spanish2_ci DEFAULT NULL,
  `provinciaUsu` varchar(120) COLLATE utf8mb4_spanish2_ci DEFAULT NULL,
  `ciudadPuebloUsu` varchar(120) COLLATE utf8mb4_spanish2_ci DEFAULT NULL,
  `paisUsu` varchar(50) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'PAIS',
  `personalizacionUsu` varchar(255) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Campo pra meter preferencias personalizacion',
  `idiomaUsu` int(11) DEFAULT NULL COMMENT 'Preferencia de idioma',
  `recibirNotificacionesUsu` tinyint(1) DEFAULT NULL COMMENT 'Consentimiento para recibir notificaciones',
  `registroInicioSesionUsu` date DEFAULT NULL COMMENT 'Último registro de inicio de sesión',
  `accesoPrivadoUsu` int(11) DEFAULT NULL COMMENT '0/1, acceso privado al CRM. Para activar cuando el periodo de pago este activo',
  `ipUsu` varchar(255) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'IP Ultima conexion',
  `tokenUsu` longtext COLLATE utf8mb4_spanish2_ci COMMENT 'Token Usuario',
  `registroUsu` int(11) DEFAULT NULL COMMENT '0/1 Acceso a una area privada',
  `uuidUsu` varchar(200) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'Numero de usuario en la API en caso de tener o ID secundaria',
  `idSoporte_tmUsuario` int(11) DEFAULT NULL COMMENT 'De la tabla Soporte-Ticket',
  `idTransportista_transportistas-Transporte` varchar(225) COLLATE utf8mb4_spanish2_ci DEFAULT NULL COMMENT 'De la tabla Id Trabajadores del modulo de Transporte transportistas-Transporte'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish2_ci;

